import React from 'react'
interface rating{
    value: number;
    text:string;
}
const Rating = (props: rating) => {
    return (
        <div>
        <h1>{props.value}</h1>    
            <h2>{props.text}</h2>

            <div className="stars">
                <i className={props.value >= 1
                 ? 'fas fa-star' 
                 : props.value >= 0.5 
                 ? 'fas fa-star-half-alt'
                 :'fas fa-star' }></i>
            </div>
        </div>
        
    )
}

export default Rating
